const flex_atu = {
}

if (msg.topic === "atu") {
    flex_atu.status = msg.payload.status

    if (msg.payload.status === "TUNE_MANUAL_BYPASS") {
        flex_atu.enabled = false
    } else if (msg.payload.status === "TUNE_SUCCESSFUL") {
        flex_atu.enabled = true
    } else if (msg.payload.status) {
        flex_atu.enabled = false
    }
    global.set("flex_atu", flex_atu)
}

return msg;

let [port, antenna] = msg.topic.split(";")

let antenna_switch = global.get("antenna_switch") || {}

antenna_switch[port + "/" + antenna] = msg.payload

if (msg.payload.selected) {
    antenna_switch[port] = antenna_switch[port] || {}
    antenna_switch[port].selected = antenna
}

global.set("antenna_switch", antenna_switch)

msg.antenna_switch_port = port
msg.antenna_switch_antenna = antenna

msg.topic = "antenna_switch/" + port + "/" + antenna

return msg;

if (msg.topic === "initialize") {
    global.set("callsign", undefined)
    global.set("flex_name", undefined)
    global.set("flex_clients", {})
} else if (msg.topic === "radio") {
    global.set("callsign", msg.payload.callsign)
    global.set("flex_name", msg.payload.nickname)
} else if (msg.topic.startsWith("client")) {
    let parts = msg.topic.split("/")
    let clients = global.get("flex_clients") || {}
    if (parts[2] === "connected") {
        clients[msg.client] = {...msg.payload, client: msg.client}
    } else if (parts[2] === "disconnected") {
        clients[msg.client] = undefined
    }
    global.set("flex_clients", clients)
}

return msg;

if (msg.topic === "transmit") {
    let transmit = global.get("flex_transmit", msg.payload)
    transmit = { ...transmit, ...msg.payload }

    if (msg.payload.dax === 1) {
        msg.dax_button_background = ""
        flow.set("dax_button_payload", "transmit set dax=0")
    } else {
        msg.dax_button_background = "gray"
        flow.set("dax_button_payload", "transmit set dax=1")
    }

    global.set("flex_transmit", transmit)
}

return msg;

