const SWITCH_ANTENNAS = 4

const PORTS = {
    "ANT1": 1,
    "ANT2": 2
}
const PORTS_BY_NUMBER = {
   1: "ANT1",
   2: "ANT2"
}

const parts = msg.topic.split("/")
const port = PORTS[parts[0]]
const antenna = parts[1]

const tx_status = global.get("flex_tx_status")
const this_slice = flow.get("this_slice")
const slice = global.get("flex_slices")[this_slice]
const antenna_switch = global.get("antenna_switch")

if (tx_status !== "READY") {
    return null
}

const rx_port = PORTS[slice.rxant]
const tx_port = PORTS[slice.txant]

const other_port = { 1: 2, 2: 1}[port]

const other_messages = []
const flex_commands = []
const faster_antenna_commands = []
const slower_antenna_commands = []

if (antenna_switch[port].selected == antenna) {
    // Antenna is already on target port, 
    // all we need to do switch the flex to that port
    if (tx_port == rx_port) {
        flex_commands.push({
            payload: "slice set " + this_slice + " rxant=" + PORTS_BY_NUMBER[port] + " txant=" + PORTS_BY_NUMBER[tx_port],
            port,
            tx_port,
            rx_port,
            antenna,
            branch: 1.01
        })
    } else {
        flex_commands.push({
            payload: "slice set " + this_slice + " rxant=" + PORTS_BY_NUMBER[port] + " txant=" + PORTS_BY_NUMBER[port],
            port,
            tx_port,
            rx_port,
            antenna,
            branch: 1.02
        })
    }
    // But just in case the Antenna Switch wants to "suggest" a different antenna
    // we insist on using the one we want.
    faster_antenna_commands.push({
        topic: port + ";" + antenna
    })
} else if (antenna_switch[other_port].selected == antenna) {
    if (tx_port != rx_port && port == rx_port) {
        // Going from split ports into single port, on the formerly RX side
        flex_commands.push({
            payload: "slice set " + this_slice + " rxant=" + PORTS_BY_NUMBER[port] + " txant=" + PORTS_BY_NUMBER[port],
            port,
            tx_port,
            rx_port,
            antenna,
            branch: 2.01
        })
    }

    // Antenna selected on other port
    // so we need to swap that antenna with the one currently in use
    // and that requires an intermediate step using another antenna not in use antenna
    let current_antenna = antenna_switch[port].selected
    let free_antenna
    for (let i = 1; i <= SWITCH_ANTENNAS; i++) {
        let str_i = String(i)
        if (str_i != current_antenna && str_i !== antenna && antenna_switch[other_port + "/" + str_i].enabled) {
            free_antenna = str_i
            break
        }
    }

    free_antenna && faster_antenna_commands.push({
        topic: other_port + ";" + free_antenna,
        current_antenna,
        free_antenna,
        antenna,
        port,
        tx_port,
        rx_port,
        other_port,
        branch: 2.2
    })
    faster_antenna_commands.push({
        topic: port + ";" + antenna
    })
    slower_antenna_commands.push({
        topic: other_port + ";" + current_antenna
    })
} else {
    // Antenna not selected on any port

    if (tx_port == rx_port && port != tx_port) {
        // Going from single port to split ports
        flex_commands.push({
            payload: "slice set " + this_slice + " rxant=" + PORTS_BY_NUMBER[port] + " txant=" + PORTS_BY_NUMBER[tx_port],
            port,
            tx_port,
            rx_port,
            antenna,
            branch: 3.1
        })
    }

    faster_antenna_commands.push({
        topic: port + ";" + antenna,
        port,
        tx_port,
        rx_port,
        antenna,
        branch: 3.2
    })
}

return [other_messages, flex_commands, faster_antenna_commands, slower_antenna_commands]


