const SNAP_STEPS = [0, 50, 250, 1000]

const this_slice = flow.get("this_slice")
const flex_slices = global.get("flex_slices")
const slice = flex_slices && flex_slices[this_slice]
if (!slice) return

const snap = flow.get("snap") || 0

if (msg.topic == "click") {
    const next_snap = SNAP_STEPS.find(i => i > snap) || SNAP_STEPS[0]
    flow.set("snap", next_snap)

    const buttonSetup = {}
    buttonSetup.enabled = true
    buttonSetup.label = next_snap || "OFF"

    return buttonSetup
} else if (msg.topic == "start") {
    const buttonSetup = {}
    buttonSetup.enabled = true
    buttonSetup.label = snap || "OFF"

    return buttonSetup
}

return null

const snap = flow.get("snap")
if (snap && snap > 0) {
    const this_slice = flow.get("this_slice")

    const snap_mhz = snap / 1000000

    const freq = msg.payload.RF_frequency

    const snapped_freq_down = freq - (freq % snap_mhz)
    const snapped_freq_up = (freq + snap_mhz) - ((freq + snap_mhz) % snap_mhz)

    const nearest_snapped_freq = (freq - snapped_freq_down) < (snapped_freq_up - freq) ? snapped_freq_down : snapped_freq_up

    if (nearest_snapped_freq != freq) {
        return {
            topic: "snap",
            payload: "slice tune " + this_slice + " " + nearest_snapped_freq
        }
    }
}

// Only pass messages where the RF frequency was changed 
